import React from "react";
import "./header.css";

// import icons from Material-UI

function Header() {
  return (
    <div>
      <div className="header_icons">
        <div>
          <HomeIcon />
          <p>HOME</p>
        </div>
      </div>
    </div>
  );
}

export default Header;
